import React, { useEffect, useState } from "react";
//import CompA from "./CompA"
const App=()=>{
    const[num,setNum]=useState(0);

    useEffect(()=>{
        alert("hi")
    })
    return(
        <>
        <button onClick={()=>
        {setNum(num+1)}
        
        }>click me {num}</button>
        </>
        
    );
}
export default App;
